import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PropertyList() {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/properties')
      .then(res => setProperties(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-4">üè† Properties for Sale</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {properties.map((prop) => (
          <div key={prop._id} className="border p-4 rounded shadow">
            <h3 className="text-xl font-semibold">{prop.title}</h3>
            <p>{prop.description}</p>
            <p className="text-green-700 font-bold">‚Çπ{prop.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default PropertyList;
